BEGIN TRAN
BEGIN TRY
DECLARE @ErrorMessage NVARCHAR(4000)
		DECLARE @ErrorSeverity INT
		DECLARE @ErrorState INT
		
EXEC [dbo].[versionяheck] 721


--DECLARE @NsiAct-------------------------------------------------------------------------------------------
	declare @NsiAct table 
			(
				tf_okato varchar(5),smocod varchar(6),nam_smop nvarchar(250),nam_smok nvarchar(250),inn nvarchar(12),Ogrn nvarchar(15),KPP nvarchar(9),index_j nvarchar(6),addr_j nvarchar(255),index_f nvarchar(6),addr_f nvarchar(254),okopf nvarchar(5),fam_ruk nvarchar(40),im_ruk nvarchar(40),ot_ruk nvarchar(40),phone nvarchar(40),fax nvarchar(40),e_mail nvarchar(40),www nvarchar(100),org numeric(1,0),d_edit date
			)

--INSERT NEW INTO  NsiCur------------------------------------------------------------------------------------------------------------
	select 
	NsiAct.tf_okato,NsiAct.smocod,NsiAct.nam_smop,NsiAct.nam_smok,NsiAct.inn,NsiAct.Ogrn,NsiAct.KPP,NsiAct.index_j,NsiAct.addr_j,NsiAct.index_f,NsiAct.addr_f,NsiAct.okopf,NsiAct.fam_ruk,NsiAct.im_ruk,NsiAct.ot_ruk,NsiAct.phone,NsiAct.fax,NsiAct.e_mail,NsiAct.www,NsiAct.org,NsiAct.d_edit, 0
	from @NsiAct NsiAct
		left join F002 NSiCur
			on NSiCur.smocod=NsiAct.smocod

	where 
		NSiCur.smocod is null

--UPDATE NsiCur------------------------------------------------------------------------------------------------------------
	update NsiCur set
NsiCur.d_edit=NsiAct.d_edit,
NsiCur.org=NsiAct.org,
NsiCur.tf_okato=NsiAct.tf_okato,
NsiCur.smocod=NsiAct.smocod,
NsiCur.nam_smop=NsiAct.nam_smop,
NsiCur.nam_smok=NsiAct.nam_smok,
NsiCur.inn=NsiAct.inn,
NsiCur.Ogrn=NsiAct.Ogrn,
NsiCur.KPP=NsiAct.KPP,
NsiCur.index_j=NsiAct.index_j,
NsiCur.ot_ruk=NsiAct.ot_ruk,
NsiCur.phone=NsiAct.phone,
NsiCur.fax=NsiAct.fax,
NsiCur.e_mail=NsiAct.e_mail,
NsiCur.www=NsiAct.www,
NsiCur.addr_j=NsiAct.addr_j,
NsiCur.index_f=NsiAct.index_f,
NsiCur.addr_f=NsiAct.addr_f,
NsiCur.okopf=NsiAct.okopf,
NsiCur.fam_ruk=NsiAct.fam_ruk,
NsiCur.im_ruk=NsiAct.im_ruk
	from @NsiAct NsiAct
		inner join F002 NsiCur
						on NSiCur.smocod=NsiAct.smocod

	where
		isnull(NsiCur.d_edit,'19000101')<>isnull(NsiAct.d_edit,'19000101') or
isnull(NsiCur.org,'0')<>isnull(NsiAct.org,'0') or
isnull(NsiCur.tf_okato,'')<>isnull(NsiAct.tf_okato,'') or
isnull(NsiCur.smocod,'')<>isnull(NsiAct.smocod,'') or
isnull(NsiCur.nam_smop,'')<>isnull(NsiAct.nam_smop,'') or
isnull(NsiCur.nam_smok,'')<>isnull(NsiAct.nam_smok,'') or
isnull(NsiCur.inn,'')<>isnull(NsiAct.inn,'') or
isnull(NsiCur.Ogrn,'')<>isnull(NsiAct.Ogrn,'') or
isnull(NsiCur.KPP,'')<>isnull(NsiAct.KPP,'') or
isnull(NsiCur.index_j,'')<>isnull(NsiAct.index_j,'') or
isnull(NsiCur.ot_ruk,'')<>isnull(NsiAct.ot_ruk,'') or
isnull(NsiCur.phone,'')<>isnull(NsiAct.phone,'') or
isnull(NsiCur.fax,'')<>isnull(NsiAct.fax,'') or
isnull(NsiCur.e_mail,'')<>isnull(NsiAct.e_mail,'') or
isnull(NsiCur.www,'')<>isnull(NsiAct.www,'') or
isnull(NsiCur.addr_j,'')<>isnull(NsiAct.addr_j,'') or
isnull(NsiCur.index_f,'')<>isnull(NsiAct.index_f,'') or
isnull(NsiCur.addr_f,'')<>isnull(NsiAct.addr_f,'') or
isnull(NsiCur.okopf,'')<>isnull(NsiAct.okopf,'') or
isnull(NsiCur.fam_ruk,'')<>isnull(NsiAct.fam_ruk,'') or
isnull(NsiCur.im_ruk,'')<>isnull(NsiAct.im_ruk,'') 



EXEC [dbo].[versionUpdate] 722
COMMIT TRAN;		
END TRY
		BEGIN CATCH			
			SET @ErrorMessage= ERROR_MESSAGE()
			SET @ErrorSeverity= ERROR_SEVERITY()
			SET @ErrorState= ERROR_STATE()
			RAISERROR (@ErrorMessage,@ErrorSeverity,@ErrorState)
			IF (@@trancount > 0) ROLLBACK TRAN						
		END CATCH
IF (@@trancount > 0) ROLLBACK TRAN;
